import React from 'react';
import logo from './public/logo/logo_black.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      </header>
      <img src={logo} className="App-logo" alt="logo" />
    </div>
  );
}

export default App;
